class MatchesFinalsComponent {
    constructor(calendar, tournamentService, countriesService, tournamentGroupsService, tournamentMatchesService, tournamentTeamsService, tournamentResultsService, router) {
        this.calendar = calendar;
        this.tournamentService = tournamentService;
        this.countriesService = countriesService;
        this.tournamentGroupsService = tournamentGroupsService;
        this.tournamentMatchesService = tournamentMatchesService;
        this.tournamentTeamsService = tournamentTeamsService;
        this.tournamentResultsService = tournamentResultsService;
        this.router = router;
        this.tournament = {};
        this.matches = [];
        this.match = {};
        this.federations = [];
        this.countries = [];
        this.groups = [];
        this.group = {};
        this.teams = [];
        this.results = [];
    }
    ngOnInit() {
        this.tournamentTeamsService.getTeams().subscribe(res => this.teams = res, error => console.log(error));
        this.tournamentMatchesService.getMatches().subscribe(res => this.matches = res, error => console.log(error));
        this.tournamentGroupsService.getGroups().subscribe(res => this.groups = res, error => console.log(error));
        this.tournamentResultsService.getResultsClassified(this.tournamentId).subscribe(res => this.results = res, error => console.log(error));
    }
    updateHomeTeam(event, id) {
        let country = [];
        const status = '1';
        this.countriesService.getCountryById(event.value).subscribe(res => {
            country = res,
                this.tournamentMatchesService.updateHomeTeam(id, event.value, country.name, country.flagUrl, this.tournamentId, status);
        }, error => console.log(error));
    }
    updateVisitTeam(event, id) {
        let country = [];
        this.countriesService.getCountryById(event.value).subscribe(res => {
            country = res,
                this.tournamentMatchesService.updateVisitTeam(id, event.value, country.name, country.flagUrl, this.tournamentId);
        }, error => console.log(error));
    }
    updateHomeScore(event, id) {
        let match = [];
        this.tournamentMatchesService.updateHomeScore(id, event.value);
        this.tournamentMatchesService.getMatchById(id).subscribe(res => {
            match = res;
            if (match.homeScore > match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, match.homeTeamId, match.homeTeamName, match.homeFlag);
                this.tournamentMatchesService.updateLoser(id, match.visitTeamId, match.visitTeamName, match.visitFlag);
                this.tournamentMatchesService.updateDraw(id, false);
            }
            else if (match.homeScore < match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, match.visitTeamId, match.visitTeamName, match.visitFlag);
                this.tournamentMatchesService.updateLoser(id, match.homeTeamId, match.homeTeamName, match.homeFlag);
                this.tournamentMatchesService.updateDraw(id, false);
            }
            else if (match.homeScore === match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, '', '', '');
                this.tournamentMatchesService.updateLoser(id, '', '', '');
                this.tournamentMatchesService.updateDraw(id, true);
            }
        }, error => console.log(error));
    }
    updateVisitScore(event, id) {
        let match = [];
        this.tournamentMatchesService.updateVisitScore(id, event.value);
        this.tournamentMatchesService.getMatchById(id).subscribe(res => {
            match = res;
            if (match.homeScore > match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, match.homeTeamId, match.homeTeamName, match.homeFlag);
                this.tournamentMatchesService.updateLoser(id, match.visitTeamId, match.visitTeamName, match.visitFlag);
                this.tournamentMatchesService.updateDraw(id, false);
            }
            else if (match.homeScore < match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, match.visitTeamId, match.visitTeamName, match.visitFlag);
                this.tournamentMatchesService.updateLoser(id, match.homeTeamId, match.homeTeamName, match.homeFlag);
                this.tournamentMatchesService.updateDraw(id, false);
            }
            else if (match.homeScore === match.visitScore) {
                this.tournamentMatchesService.updateWinner(id, '', '', '');
                this.tournamentMatchesService.updateLoser(id, '', '', '');
                this.tournamentMatchesService.updateDraw(id, true);
            }
        }, error => console.log(error));
    }
    updateDateMatch(event, id) {
        const months = ['Enero', 'Febrero', 'Marzo', 'Abril', 'Mayo', 'Junio', 'Julio', 'Agosto', 'Septiembre', 'Octubre', 'Noviembre', 'Diciembre'];
        const startDate = event.day + ' de ' + months[(event.month - 1)] + ' de ' + event.year;
        this.tournamentMatchesService.updateDateMatch(id, startDate);
    }
    updateTimeMatch(event, id) {
        this.tournamentMatchesService.updateTimeMatch(id, event.value);
    }
    gameStatus(event, match) {
        if (event.value === '1') {
            if (confirm('Desea confirmar el partido por finalizado?')) {
                this.tournamentMatchesService.updateStatus(match.id, event.value);
            }
        }
        else if (event.value === '0') {
            if (confirm('Desea modificar el partido?')) {
                this.tournamentMatchesService.updateStatus(match.id, event.value);
            }
        }
        let matchArray = [];
        let resultArray = [];
        let tournamentStage;
        let podium;
        this.tournamentMatchesService.getMatchById(match.id).subscribe(res => {
            matchArray = res;
            console.log(matchArray.phase);
            switch (matchArray.phase) {
                case '16vos de final':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        tournamentStage = '8vos de final';
                        /* this.tournamentResultsService.updateStage(resultArray[0].id, tournamentStage); */
                    }, error => console.log(error));
                    break;
                case '8vos de final':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        tournamentStage = '4tos de final';
                        /* this.tournamentResultsService.updateStage(resultArray[0].id, tournamentStage); */
                    }, error => console.log(error));
                    break;
                case '4tos de final':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        tournamentStage = 'Semifinal';
                        /* this.tournamentResultsService.updateStage(resultArray[0].id, tournamentStage); */
                    }, error => console.log(error));
                    break;
                case 'Semifinal':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        tournamentStage = 'Final';
                        /* this.tournamentResultsService.updateStage(resultArray[0].id, tournamentStage); */
                    }, error => console.log(error));
                    this.tournamentResultsService.getResultByTeam(matchArray.loserId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        tournamentStage = '3er Lugar';
                        /* this.tournamentResultsService.updateStage(resultArray[0].id, tournamentStage); */
                    }, error => console.log(error));
                    break;
                case '3er Lugar':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        podium = 'thirdPlace';
                        this.tournamentResultsService.updatePodium(resultArray[0].id, podium);
                    }, error => console.log(error));
                    break;
                case 'Final':
                    this.tournamentResultsService.getResultByTeam(matchArray.winnerId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        podium = 'firstPlace';
                        this.tournamentResultsService.updatePodium(resultArray[0].id, podium);
                    }, error => console.log(error));
                    this.tournamentResultsService.getResultByTeam(matchArray.loserId, this.tournamentId).subscribe(result => {
                        resultArray = result;
                        podium = 'secondPlace';
                        this.tournamentResultsService.updatePodium(resultArray[0].id, podium);
                    }, error => console.log(error));
                    break;
                default:
            }
        }, error => console.log(error));
    }
}
